(39, 6, 'NajmanjÅ¡i element v iskalnem drevesu', '<h4><strong>VpraÅ¡anje:</strong></h4><p>NajmanjÅ¡i element v iskalnem drevesu</p><h4><strong>KljuÄne besede:</strong></h4><p>DvojiÅ¡ko drevo</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/find-the-minimum-element-in-a-binary-search-tree/\">http://www.geeksforgeeks.org/find-the-minimum-element-in-a-binary-search-tree/</a><h4><strong>Odgovor:</strong></h4><p><p>Imamo iskalno dvoji&scaron;ko drevo, zato je manj&scaron;i element vedno v levo od korena. Torej bo najmanj&scaron;i element v drevesu vedno najbolj levo. Algoritem ima v najslab&scaron;em primeru Äasovno zahtevnost O(n) n- &scaron;tevilo vozli&scaron;Ä , v povpreÄju pa O(m) , m- je vi&scaron;ina drevesa.</p>\r\n<p><img src=\"../source/Drevo%201.jpg\" alt=\"\" width=\"221\" height=\"177\" />&nbsp;---&gt;&nbsp;<img src=\"../source/drevo2%20(1).jpg\" alt=\"\" width=\"221\" height=\"177\" /></p></p><h4><strong>Dodatne opombe:</strong></h4><p>Poseben primer je prazno drevo. V tem primeru ne vrnemo niÄ.</p>', 'DvojiÅ¡ko drevo', 1, 33),
(40, 6, 'Izbris vozliÅ¡Äa iz veriÅ¾nega seznama', '<h4><strong>VpraÅ¡anje:</strong></h4><p>IzbriÅ¡i vozliÅ¡Äe iz veriÅ¾nega seznama</p><h4><strong>KljuÄne besede:</strong></h4><p>Sklad, VeriÅ¾ni seznam</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/linked-list-set-3-deleting-node/\">http://www.geeksforgeeks.org/linked-list-set-3-deleting-node/</a><h4><strong>Odgovor:</strong></h4><p><p>V veriÅ¾nem seznamu izbri&scaron;emo vozli&scaron;Äe v dveh korakih:&nbsp;</p>\r\n<p>Najprej poi&scaron;Äemo predhodnika vozli&scaron;Äa, ki ga Å¾elimo izbrisat.</p>\r\n<p>Zamenjamo naslednjika, prehdoniku.&nbsp;</p>\r\n<p>Torej, ko najdemo vozli&scaron;Äe, ki ga Å¾elimo izbrisati, vemo tudi kdo je njegov predhodnik. Predhodnika \'poveÅ¾emo\' z naslednjikom vozli&scaron;Äa, ki ga Å¾elimo odstraniti. Tako smo odstranili vozli&scaron;Äe. Problem nastane, ko Å¾elimo izbrisati prvo vozli&scaron;Äe. V tem prmeru, moramo \'povezati\' naslov veriÅ¾nega seznama na drugi element v veriÅ¾nem seznamu.</p>\r\n<p>&nbsp;<img src=\"../source/izbri%C5%A1i%20vozli%C5%A1%C4%8De%20(2).png\" alt=\"\" /></p>\r\n<p>&nbsp;</p></p><h4><strong>Dodatne opombe:</strong></h4><p>Koda je kopirana iz strani (vir:http://www.geeksforgeeks.org/linked-list-set-3-deleting-node/)</p>', 'Sklad, VeriÅ¾ni seznam', 1, 34),
(41, 6, 'Kako deluje \"hitro urejanje\"', '<h4><strong>VpraÅ¡anje:</strong></h4><p>Kako deluje \"hitro urejanje\"</p><h4><strong>KljuÄne besede:</strong></h4><p>Urejanje</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/quick-sort/\">http://www.geeksforgeeks.org/quick-sort/</a><h4><strong>Odgovor:</strong></h4><p><p>Seznam, ki ga Å¾elimo urediti razdelimo na dva podseznama. Vzamemo nek pivot. Nato seznam pregledujemo iz leve in desne strani. Levi indeks poveÄujemo, dokler ne pridemo do elementa, ki je veÄji od pivota. Zatem pa zmanj&scaron;ujemo desni indeks, dokler element, ki ga pregledujemo ni manj&scaron;i od pivota. ÄŒe je levi element veÄji in desni manj&scaron;i od pivota in se indeksa &scaron;e nista \"prekriÅ¾ala\", ju zamenjamo. ÄŒe sta se indeksa Å¾e prektiÅ¾ala zamenjamo desni indeks z pivotom.</p>\r\n<p>Nato algoritem rekuzivno ponavljamo na podzaporedjih, dokler ni podzaporedje dolÅ¾ine ena. VsakiÄ pa vzamemo nov pivot, saj je prej&scaron;nji Å¾e na pravem mestu.</p>\r\n<p><strong>Dodatni viri</strong>: &nbsp; &nbsp;</p>\r\n<ul>\r\n<li><a href=\"https://www.khanacademy.org/computing/computer-science/algorithms/quick-sort/a/overview-of-quicksort\" target=\"_blank\" rel=\"noopener noreferrer\">https://www.khanacademy.org/computing/computer-science/algorithms/quick-sort/a/overview-of-quicksort</a></li>\r\n<li><a href=\"https://sl.wikipedia.org/wiki/Hitro_urejanje\" target=\"_blank\" rel=\"noopener noreferrer\">https://sl.wikipedia.org/wiki/Hitro_urejanje</a></li>\r\n<li><a href=\"https://www.youtube.com/watch?v=aQiWF4E8flQ\" target=\"_blank\" rel=\"noopener noreferrer\">https://www.youtube.com/watch?v=aQiWF4E8flQ</a></li>\r\n</ul></p><h4><strong>Dodatne opombe:</strong></h4><p>Â  Â Â  Algoritmi se razlikujejo glede na to, kakÅ¡en pivot vzamejo. Lahko je to prvi element, lahko je zadnji ali pa nakljuÄni. Pri veliki koliÄini podatkov, se lahko algoritmi Äasovno zelo razlikujejo.Â   Â Â  V povpreÄju pa je Äasovna zahtevnos algoritma O(n*log(n)), v najslabÅ¡ih primerih pa O(n^2)</p>', 'Urejanje', 1, 35),
(42, 6, 'Vsota vseh levih sinov v dvojiÅ¡kem drevesu', '<h4><strong>VpraÅ¡anje:</strong></h4><p>PoiÅ¡Äi vsoto vseh levih sinov v dvojiÅ¡kem drevesu</p><h4><strong>KljuÄne besede:</strong></h4><p>DvojiÅ¡ko drevo</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/find-sum-left-leaves-given-binary-tree/\">http://www.geeksforgeeks.org/find-sum-left-leaves-given-binary-tree/</a><h4><strong>Odgovor:</strong></h4><p><p>Problem lahko re&scaron;imo tako, da gremo Äez celo dano drevo in za vsako levo poddrevo preverimo ali je vozli&scaron;Äe list.</p></p><h4><strong>Dodatne opombe:</strong></h4><p>ÄŒasovna zahtevnost je O(n), kjer je n Å¡tevilo vozliÅ¡Ä v drevesu.</p>', 'DvojiÅ¡ko drevo', 1, 36),
(43, 6, 'Unija in presek dveh urejenih mnoÅ¾ic', '<h4><strong>Vpra&scaron;anje:</strong></h4>\r\n<p>Unija in presek dveh urejenih mnoÅ¾ic</p>\r\n<h4><strong>KljuÄne besede:</strong></h4>\r\n<p>Unija, Presek</p>\r\n<h4><strong>Vir:</strong></h4>\r\n<p><a href=\"http://www.geeksforgeeks.org/union-and-intersection-of-two-sorted-arrays-2/\">http://www.geeksforgeeks.org/union-and-intersection-of-two-sorted-arrays-2/</a></p>\r\n<h4><strong>Odgovor:</strong></h4>\r\n<p>Naredimo dve spremenljivki in gremo z vsako po eni mnoÅ¾ici. &Scaron;tevila primerjamo med sabo, dodamo tisto, ki je manj&scaron;a in poveÄamo tisto spremenljivko, ki gre po mnoÅ¾ici iz katere smo vzeli &scaron;tevilo. V primeru, da sta &scaron;tevili isti, dodamo in poveÄamo obe spremenljivki. Na koncu dodamo &scaron;e dve zanki, ki dodasta &scaron;e &scaron;tevila, ki so ostala v eni&nbsp; izmed mnoÅ¾ic.</p>\r\n<h4><strong>Dodatne opombe:</strong></h4>\r\n<p>ÄŒasovna zahtevnost je O(m+n), kjer je m dolÅ¾ina prve mnoÅ¾ice, n pa dolÅ¾ina druge. Problem lahko z pytonom re&scaron;imo tudi s pomoÄjo vgrajenih funkcij union in intersection.</p>', 'Unija, Presek', 1, 37),
(44, 6, 'Izpis vseh vozliÅ¡Ä, ki nimajo brata', '<h4><strong>VpraÅ¡anje:</strong></h4><p>IzpiÅ¡i vsa vozliÅ¡Äa, ki nimajo brata</p><h4><strong>KljuÄne besede:</strong></h4><p>DvojiÅ¡ko drevo</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/print-nodes-dont-sibling-binary-tree/\">http://www.geeksforgeeks.org/print-nodes-dont-sibling-binary-tree/</a><h4><strong>Odgovor:</strong></h4><p><p>Problem lahko re&scaron;imo tako, da gremo Äez celo dano drevo in pogledamo ali ima oÄe dva ali enega sina. V primeru, da ima samo enega, sina izpi&scaron;emo.</p></p><h4><strong>Dodatne opombe:</strong></h4><p>ÄŒasovna zahtevnost je O(n), kjer je n Å¡tevilo vozliÅ¡Ä v drevesu.</p>', 'DvojiÅ¡ko drevo', 1, 38),
(47, 6, 'PloÅ¡Äina najveÄjega pravokotnika v histogramu', '<h4><strong>VpraÅ¡anje:</strong></h4><p>PloÅ¡Äina najveÄjega pravokotnika v histogramu</p><h4><strong>KljuÄne besede:</strong></h4><p>Sklad</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/largest-rectangle-under-histogram/\">http://www.geeksforgeeks.org/largest-rectangle-under-histogram/</a><h4><strong>Odgovor:</strong></h4><p><p>&nbsp;Gremo Äez vse stolpce histograma in za vsak stolpec izraÄunamo plo&scaron;Äino najveÄjega pravokotnika, ki ga vsebuje. Pravokotnik zakljuÄimo, ko pridemo do manj&scaron;ega stolpca in ne moremo nadaljevati z isto vi&scaron;ino. Vi&scaron;ino \"odprtih\" pravokotnikov in indeks njihovega zaÄetka vodimo v dveh skladih.</p>\r\n<p>Razdelan odgovor je na priloÅ¾enih datotekah.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Dodatni viri</strong>: &nbsp; &nbsp;</p>\r\n<p>http://tech-queries.blogspot.si/2011/03/maximum-area-rectangle-in-histogram.html</p>\r\n<p>https://www.glassdoor.com/Interview/Find-the-maximum-rectangle-in-terms-of-area-under-a-histogram-in-linear-time-QTN_11443.htm</p>\r\n<p>https://www.quora.com/What-is-the-algorithmic-approach-to-find-the-maximum-rectangular-area-in-a-histogram</p>\r\n<p>http://stackoverflow.com/questions/4311694/maximize-the-rectangular-area-under-histogram</p></p><h4><strong>Dodatne opombe:</strong></h4><p>Odgovor na to vpraÅ¡anje je na strani geeksforgeeks predstavljeno v dveh razliÄicah. Prvo je z metodo deli in vladaj, vendar je tam Äasovna zahtevnost O(nLogn). ReÅ¡itev s skladi je Äasovne zahtevnosti O(n). Moja implementacija reÅ¡itve je (kot na nekaterih drugih straneh) taka, da uporabljam dva sklada, saj se mi je to zdelo bolj razumljivo in primerno za predstavitev.  Predpostavljeno je tudi, da so stolpci Å¡irine 1.</p>', 'Sklad', 1, 39),
(48, 6, 'CikloÄnost veriÅ¾nega seznama ', '<h4><strong>Vpra&scaron;anje:</strong></h4>\r\n<p>Napi&scaron;i funkcijo, ki preveri, ali veriÅ¾ni seznam vsebuje cikel</p>\r\n<h4><strong>KljuÄne besede:</strong></h4>\r\n<p>VeriÅ¾ni seznam</p>\r\n<h4><strong>Vir:</strong></h4>\r\n<p><a href=\"http://www.programmerinterview.com/index.php/data-structures/how-to-find-if-a-linked-list-is-circular-or-has-a-cycle-or-it-ends/\">http://www.programmerinterview.com/index.php/data-structures/how-to-find-if-a-linked-list-is-circular-or-has-a-cycle-or-it-ends/</a></p>\r\n<h4><strong>Odgovor:</strong></h4>\r\n<p>Najprej si malo razjasnimo pojme: Cirkularni oz. kroÅ¾ni veriÅ¾ni seznam je tisti, pri katerem zadnji vozel kaÅ¾e nazaj na prvega.</p>\r\n<p>Posplo&scaron;itev tega je veriÅ¾ni seznam s ciklom, kar pomeni, da zadnji vozel kaÅ¾e na kateregakoli od prej&scaron;njih.</p>\r\n<p>AcikliÄen veriÅ¾ni seznam pa je tak, ki nima ciklov (kakr&scaron;nega najbolje poznamo). Zadnji vozel v tem primeru kaÅ¾e na None.</p>\r\n<p>Kako bi ugotovili, Äe seznam vsebuje cikel? Lahko se sprehodimo s kazalcem preko vseh vozlov in vrnemo False, ko pridemo do None. To bi delovalo za acikliÄne VS, Äe pa seznam vsebuje cikel, pa do do vrednosti None ne bomo nikoli pri&scaron;li. Ta re&scaron;itev se torej ne obnese.</p>\r\n<p>Lahko bi poleg preverjanja, Äe smo pri&scaron;li do None, v nek seznam dodajali kazalce na vozle, ki smo jih Å¾e obiskali. ÄŒe bi pri&scaron;li do Å¾e obiskanega, bi vrnili True in tako ujeli oba primera. To ni najbolj&scaron;a re&scaron;iev, saj bi morali na tak naÄin primerjati vsakega tolikokrat, olikor vozlov je bilo pred njim &ndash; prvega nikoli, drugega enkrat (s prvim) tretjega dvakrat (s prvim in drugim). Torej bi bilo primerjanj 1 + 2 + ... + n, kar pa je enako n(n+1)/2. To pomeni, da bi bla Äasovna zahtevnost O(n^2).</p>\r\n<p>Za ugotavljanje, ali obstaja cikel, bomo uporabili algoritem zajca in Å¾elve. To pomeni, da bomo uporabili dva kazalca; enega hitrej&scaron;ega in enega poÄasnej&scaron;ega, ki se bosta sprehodila Äez na&scaron; veriÅ¾ni seznam. PoÄasnej&scaron;i se bo premikal po en, hitrej&scaron;i pa po dva vozla naprej. Zakaj je to algoritem zajca in Å¾elve in kako deluje? Recimo, da imamo acikliÄen veriÅ¾ni seznam oz. pot, ki se nekje konÄa. ÄŒe gresta zajec in Å¾elva po tej poti, bo zajec prvi pri&scaron;el do konca in tako vemo, da po ni kroÅ¾na.</p>\r\n<p>ÄŒe pa imamo cikel, si to lahko predstavljamo kot krog. V tem primeru bo zajec, ki je hitrej&scaron;i, zagotovo na neki toÄki ujel Å¾elvo, tako, da bosta ponovno na isti poziciji (predstavljamo si lahko tudi kot urine kazalce, kjer se npr. Minutni in sekundni kazalec vedno nekje pokrijeta).</p>\r\n<p>ÄŒe to prevedemo na veriÅ¾ni seznam; hitrej&scaron;i kazalec premikamo za 2, poÄasnej&scaron;i pa za 1.</p>\r\n<p>&nbsp;</p>\r\n<p>Funkcija:</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>def aliObstajaCikel(prvi):</p>\r\n<p>\'\'\'vrne True, Äe se zadnji vozel povezan na katerega od prej&scaron;njih in False, Äe se veriÅ¾ni seznam nekje konÄa\'\'\'</p>\r\n<p>#na zaÄetku sta oba kazalca na istem mestu</p>\r\n<p>&nbsp;&nbsp;&nbsp; zelva = prvi</p>\r\n<p>&nbsp;&nbsp;&nbsp; zajec = prvi</p>\r\n<p>&nbsp;&nbsp;&nbsp; while zajec != None:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; #premaknemo zelvo</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; zelva = zelva.naslednji</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; #premaknemo zajca, ampak samo v primeru, da nismo na zadnjem vozlu</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; #v tem primeru ga nimamo veÄ kam premakniti</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; if zajec.naslednji != None:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; zajec = zajec.naslednji.naslednji</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; else:</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; return False</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; if zajec == zelva: #kazalca sta se ujela, torej obstaja cikel</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; return True</p>\r\n<p>&nbsp;&nbsp;&nbsp; return False</p>\r\n<p># koda povzeta po:&nbsp;&nbsp;<a href=\"http://stackoverflow.com/questions/20353835/fastest-way-to-prove-linked-list-is-circular-in-python\">http://stackoverflow.com/questions/20353835/fastest-way-to-prove-linked-list-is-circular-in-python</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Dodatne opombe:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Pri tem veriÅ¾nega seznama ne smemo spreminjati, kot vhodni parameter pa dobimo prvi vozel.</p>\r\n<p>&nbsp;</p>\r\n<p>Treba je opozoriti na to, da je to drugaÄno vpra&scaron;anje kot to:</p>\r\n<p><a href=\"http://www.geeksforgeeks.org/check-if-a-linked-list-is-circular-linked-list/\">http://www.geeksforgeeks.org/check-if-a-linked-list-is-circular-linked-list/</a></p>\r\n<p><strong>Dodatni viri</strong>: &nbsp; &nbsp;</p>\r\n<p><a href=\"http://stackoverflow.com/questions/20353835/fastest-way-to-prove-linked-list-is-circular-in-python\">http://stackoverflow.com/questions/20353835/fastest-way-to-prove-linked-list-is-circular-in-python</a></p>\r\n<p>&nbsp;</p>\r\n<h4>&nbsp;</h4>', 'VeriÅ¾ni seznam', 1, 35),
(49, 6, 'SeÅ¡tej dve Å¡tevili, predstavljeni z veriÅ¾nim seznamom svojih Å¡tevk', '<h4><strong>VpraÅ¡anje:</strong></h4><p>SeÅ¡tej dve Å¡tevili, predstavljeni z veriÅ¾nim seznamom svojih Å¡tevk</p><h4><strong>KljuÄne besede:</strong></h4><p>VeriÅ¾ni seznam</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/add-two-numbers-represented-by-linked-lists/\">http://www.geeksforgeeks.org/add-two-numbers-represented-by-linked-lists/</a><h4><strong>Odgovor:</strong></h4><p><p>Vpra&scaron;anje je zastavljeno tako, da imamo podana veriÅ¾na seznama s &scaron;tevkami v obratnem vrstnem redu (enice so na prvem mestu). To je za se&scaron;tevanje laÅ¾je, saj tudi roÄni &scaron;tevila se&scaron;tevamo od zadnjega mesta naprej.</p>\r\n<p><img src=\"../source/rocno.png\" alt=\"\" width=\"172\" height=\"190\" /></p>\r\n<p>Tako bomo paroma se&scaron;tevali tudi podatke v veriÅ¾nem seznamu, dokler obeh ne zmanjka. Ko je konec enega, njegov podatek predstavlja &scaron;tevilo 0 (torej preostanku drugega pri&scaron;tevamo &scaron;tevilo 0).</p>\r\n<p>Pri tem imamo tudi spremenljivko dodaj, ki ima vrednost 1 ali 0, glede na to, ali je bilo prej&scaron;nje &scaron;tevilo veÄje od 10 ali ne.</p>\r\n<p><img src=\"../source/zVS.png\" alt=\"\" width=\"469\" height=\"383\" /></p></p><h4><strong>Dodatne opombe:</strong></h4><p>Obstaja tudi vpraÅ¡anje, ki predpostavlja, da so Å¡tevke v veriÅ¾nem seznamu v pravilnem vrstnem redu.</p>', 'VeriÅ¾ni seznam', 1, 43),
(50, 6, 'Funkcija, ki preveri, ali podatki veriÅ¾nega seznama tvorijo palindrom', '<h4><strong>Vpra&scaron;anje:</strong></h4>\r\n<p>Napi&scaron;i funkcijo, ki preveri, ali podatki veriÅ¾nega seznama tvorijo palindrom</p>\r\n<h4><strong>KljuÄne besede:</strong></h4>\r\n<p>VeriÅ¾ni seznam, Sklad</p>\r\n<h4><strong>Vir:</strong></h4>\r\n<p><a href=\"http://www.geeksforgeeks.org/function-to-check-if-a-singly-linked-list-is-palindrome/\">http://www.geeksforgeeks.org/function-to-check-if-a-singly-linked-list-is-palindrome/</a></p>\r\n<h4><strong>Odgovor:</strong></h4>\r\n<p>Problem lahko re&scaron;imo na dva naÄina:&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>NaÄin: S pomoÄjo podatkovne strukture sklad. Ideja je v tem, da se sprehodimo po veriÅ¾nem seznamu in podatke v vozlih damo po vrsti v sklad. Nato jemljemo iz sklada elemente in pregledujemo Äe so enaki po vrsti kot v veriÅ¾nem seznamu. Uporabimo sklad, ker vrstni red elementov s pomoÄjo sklada obrnemo.</li>\r\n<li>NaÄin: Najprej poi&scaron;Äemo kazalec na sredinski vozel v veriÅ¾nem seznamu. Nato obrnemo drugo polovico veriÅ¾nega seznama in primerjamo podatke v drugi polovici z prvo polovico. Na koncu spet obrnemo drugo polovico veriÅ¾nega seznama zato, da seznam ostane nespremenjen.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>ÄŒasovna zahtevnost:</strong>&nbsp;ÄŒasovna zahtevnost prve re&scaron;itve je O(n), kjer je n &scaron;tevilo vozlov v veriÅ¾nem seznamu. Prostorska zahtevnost je O(n), saj rabimo dodatno n prostora, ker vse podatke veriÅ¾nega seznama damo v sklad. ÄŒasovna zahtevnost druge re&scaron;itve je O(n). Prostorska zahtevnost je O(1), saj spreminjamo le obstojeÄi veriÅ¾ni seznam, ne rabimo pa dodatnega prostora.</p>\r\n<p><strong>Primera:</strong></p>\r\n<p id=\"yui_3_17_2_2_1502039304315_204\"><strong id=\"yui_3_17_2_2_1502039304315_203\"><img src=\"../source/1.Vprasanje.png\" alt=\"\" width=\"622\" height=\"226\" /><br /></strong></p>\r\n<p>ÄŒe si pogledamo prvi primer veriÅ¾nega seznama in \'preberemo\' elemente v veriÅ¾nem seznamu od leve proti desni, ter nato \'preberemo\' elemente veriÅ¾nega seznama iz desne proti levi, bomo v obeh primerih prebrali enako besedo, to je \'ABCCBA\'. Torej elementi prvega veriÅ¾nega seznama tvorijo palindrom.</p>\r\n<p>ÄŒe pa poskusimo na drugem primeru, je prebrana beseda iz leve v desno enaka \'ABCCCA\', iz desne v levo pa \'ACCCBA\'. Zato elementi drugega veriÅ¾nega seznama ne tvorijo palindroma.</p>\r\n<h4><strong>Dodatne opombe:</strong></h4>\r\n<p>Dodatni viri: http://www.geeksforgeeks.org/check-linked-list-strings-form-palindrome/</p>', 'VeriÅ¾ni seznam, Sklad', 1, 44),
(51, 6, 'Izpis podatkov dvojiÅ¡kega drevesa v \'spiralni obliki\'.', '<h4><strong>VpraÅ¡anje:</strong></h4><p>Dano je dvojiÅ¡ko drevo. IzpiÅ¡i podatke dvojiÅ¡kega drevesa v \'spiralni obliki\'.</p><h4><strong>KljuÄne besede:</strong></h4><p>DvojiÅ¡ko drevo, Sklad</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/level-order-traversal-in-spiral-form/\">http://www.geeksforgeeks.org/level-order-traversal-in-spiral-form/</a><h4><strong>Odgovor:</strong></h4><p><p>Spodnja slika prikazuje na primeru, kako izgleda spiralni izpis dvoji&scaron;kega drevesa:</p>\r\n<p id=\"yui_3_17_2_2_1502039304315_217\"><img src=\"../source/SpiralnaSlika.png\" alt=\"\" width=\"558\" height=\"437\" /></p>\r\n<p>Problem lahko re&scaron;imo s pomoÄjo dveh skladov. V prvi sklad dajemo tista vozli&scaron;Äa, ki jih bomo izpisali iz leve v desno, medtem ko v drugi sklad tista, ki jih bomo izpisali iz desne v levo. Postopek bomo ponavljali dokler ne bosta oba sklada prazna. Najprej vozli&scaron;Äe v korenu damo v prvi sklad. Nato &nbsp;iz prvega sklada vzamemo zgornji element, ga izpi&scaron;emo, in pogledamo, ali ima levega sina. ÄŒe ga ima, ga damo v drugi sklad. Nato pogledamo Äe ima desnega sina. ÄŒe ga ima, ga damo v drugi sklad. Postopek ponovimo dokler prvi sklad ni prazen. Podobno naredimo na drugem skladu. Vzamemo zgornji element iz sklada, ga izpi&scaron;emo, in pogledamo ali ima desnega sina. ÄŒe ga ima, ga dodamo v prvi sklad. Pogledamo &scaron;e, Äe ima levega sina in Äe ga ima, ga damo v prvi sklad. Postopek ponovimo, dokler drugi sklad ni prazen. Postopek dodajanja v sklada ponovimo, dokler oba sklada nista prazna.&nbsp;</p>\r\n<p><strong>Dodatni viri:</strong>&nbsp;<a href=\"http://www.java2blog.com/2014/08/spiralzigzag-level-order-traversal-of.html\">http://www.java2blog.com/2014/08/spiralzigzag-level-order-traversal-of.html</a></p></p><h4><strong>Dodatne opombe:</strong></h4><p>Podatke dvojiÅ¡kega drevesa bi lahko izpisali tudi tako, da bi sode nivoje drevesa izpisali iz leve v desno, lihe nivoje pa iz desne v levo. To bi enostavno naredili tako, da bi zamenjali vrstni red dodajanja vozliÅ¡Ä v sklada in sicer tako, da bi v prvi sklad najprej dajali leve sine nato pa desne sine vozliÅ¡Ä, ki jih jemljemo iz desnega sklada, v drugi sklad pa najprej desne sine, ter nato leve sine vozliÅ¡Ä, ki jih jemljemo iz prvega sklada.</p>', 'DvojiÅ¡ko drevo, Sklad', 1, 45),
(52, 6, 'DoloÄitev premera dvojiÅ¡kega drevesa', '<h4><strong>Vpra&scaron;anje:</strong></h4>\r\n<p>DoloÄi premer dvoji&scaron;kega drevesa</p>\r\n<h4><strong>KljuÄne besede:</strong></h4>\r\n<p>Dvoji&scaron;ko drevo</p>\r\n<h4><strong>Vir:</strong></h4>\r\n<p><a href=\"http://www.geeksforgeeks.org/diameter-of-a-binary-tree/\">http://www.geeksforgeeks.org/diameter-of-a-binary-tree/</a></p>\r\n<h4><strong>Odgovor:</strong></h4>\r\n<p>Ker ne vemo, kje se nahaja najdalj&scaron;a pot v dvoji&scaron;kem drevesu loÄimo tri primere:</p>\r\n<p>1. Ko gre najdalj&scaron;a pot Äez koren dvoji&scaron;kega drevesa. To prikazuje sponja slika.</p>\r\n<p><img src=\"../source/Koren.png\" alt=\"\" width=\"327\" height=\"318\" /></p>\r\n<p>V tem primeru je premer dvoji&scaron;kega drevesa enak vsoti vi&scaron;ine levega poddrevesa in vi&scaron;ine desnega poddrevesa plus ena. Vsoti pri&scaron;tejemo &scaron;e &scaron;tevilo ena, ker moramo pri&scaron;teti &scaron;e koren.</p>\r\n<p>2. Ko je najdalj&scaron;a pot v levem poddrevesu dvoji&scaron;kega drevesa (glej spodnjo sliko). V tem primeru moramo spet poiskati premer levega poddrevesa. Torej re&scaron;ujemo spet prvotni problem.</p>\r\n<p><img src=\"../source/LevoPoddrevo.png\" alt=\"\" width=\"344\" height=\"294\" /></p>\r\n<p>3. Ko je najdalj&scaron;a pot v desnem poddrevesu dvoji&scaron;kega drevesa (glej spodnjo sliko). V tem primeru moramo spet poiskati premer desnega poddrevesa. Torej re&scaron;ujemo spet prvotni problem.</p>\r\n<p><img src=\"../source/DesnoPoddrevo.png\" alt=\"\" width=\"377\" height=\"270\" /></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>Premer dvoji&scaron;kega drevesa je maksimum med dolÅ¾ino najdalj&scaron;e poti, ki gre Äez koren, premera levega poddrevesa in premera desnega poddrevesa.</p>\r\n<h4><strong>Dodatne opombe:</strong></h4>\r\n<p>Dodatni viri: http://algorithms.tutorialhorizon.com/diameter-of-a-binary-tree/</p>', 'DvojiÅ¡ko drevo', 1, 46),
(53, 6, 'NapiÅ¡i funkcijo, ki najde drugi najveÄji element v dvojiÅ¡kem iskalnem drevesu', '<h4><strong>VpraÅ¡anje:</strong></h4><p>NapiÅ¡i funkcijo, ki najde drugi najveÄji element v dvojiÅ¡kem iskalnem drevesu</p><h4><strong>KljuÄne besede:</strong></h4><p>DvojiÅ¡ko drevo</p><h4><strong>Vir:</strong></h4><a href=\"https://www.interviewcake.com/question/python/second-largest-item-in-bst\">https://www.interviewcake.com/question/python/second-largest-item-in-bst</a><h4><strong>Odgovor:</strong></h4><p><p>Problem najprej poenostavimo na iskanje najveÄjega elementa v iskalnem dvoji&scaron;kem drevesu. Te leÅ¾i v najbolj desnem delu drevesa. Pomikamo se torej po drevesu v desno dokler se lahko.</p>\r\n<p>Iskanje drugega najveÄjega elementa v iskalnem dvoji&scaron;kem drevesu loÄimo na dva primera. Prvi primer je, da je najveÄji element v drevesu list. V tem primeru je drugi najveÄji element oÄe od najveÄjega elementa. Na spodnji sliki je najveÄji element 12 in ker je list je drugi najveÄji element njegov oÄe. To je &scaron;tevilo 7.</p>\r\n<p><img src=\"../source/list.png\" alt=\"\" width=\"367\" height=\"171\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Drugi primer je , da ima najveÄji element levo poddrevo. ÄŒe ima najveÄji element levo poddrevo potem je drugi najveÄji element, najveÄji element v tem levem poddrevesu. Na spodnji sliki je najveÄji element 12 in ker ima levo poddrevo je drugi najveÄji element drevesa, najveÄji element v tem levem poddrevesu. To je &scaron;tevilo 11.</p>\r\n<p><img src=\"../source/list1.png\" alt=\"\" width=\"380\" height=\"294\" /></p>\r\n<p>&nbsp;</p></p><h4><strong>Dodatne opombe:</strong></h4><p>ÄŒe ima iskalno dvojiÅ¡ko drevo manj kot dva elementa javimo napako. NajslabÅ¡a Äasovna zahtevnost je O(n), pri desno izrojenem drevesu.Â </p>', 'DvojiÅ¡ko drevo', 1, 47),
(54, 6, 'NapiÅ¡i funkcijo, ki preveri, Äe je drevo uravnoteÅ¾eno', '<h4><strong>VpraÅ¡anje:</strong></h4><p>NapiÅ¡i funkcijo, ki preveri, Äe je drevo uravnoteÅ¾eno( drevo je uravnoteÅ¾eno, Äe je razlika v globini med dvema poljubnima listoma manj ali enaka 1)</p><h4><strong>KljuÄne besede:</strong></h4><p>DvojiÅ¡ko drevo</p><h4><strong>Vir:</strong></h4><a href=\"https://www.interviewcake.com/question/python/balanced-binary-tree\">https://www.interviewcake.com/question/python/balanced-binary-tree</a><h4><strong>Odgovor:</strong></h4><p><p>Ideja je, da s pregledom v globino pridemo do listov. Pregled v globino delamo s pomoÄjo sklada. Namesto pregleda v globino bi lahko delali pregled v &scaron;irino, katerega bi izvajali s pomoÄjo vrste. Ustvarimo &scaron;e nek seznam v katerim bomo shranjevali nivoje listov. Ko pridemo do lista, shranimo njegov nivo v seznam, Äe takega nivoja &scaron;e ni v seznamu. Po vsakem vstavljanju v seznam nivojev moramo pogledati, Äe mogoÄe drevo ni uravnoteÅ¾eno. Obstajata dve moÅ¾nosti, ki ju moramo preveriti:</p>\r\n<p>1) ÄŒe je v seznamu nivojev veÄ kot dva nivoja to drevo ni uravnoteÅ¾eno. Ker dajemo v seznam samo razliÄne nivoje in Äe imamo veÄ kot dva nivoja potem zagotovo obstaja razlika med temi nivoji, ki je veÄja od 1.</p>\r\n<p>2)ÄŒe imamo dva nivoja v seznamu in je njuna razlika veÄja od 1.</p>\r\n<p>Primer uravnoteÅ¾enega dvoji&scaron;kega drevesa(da je drevo hkrati tudi iskalno ni pomembno):</p>\r\n<p><img src=\"../source/Uravnotezenodvojiskodrevo.png\" alt=\"\" width=\"332\" height=\"206\" /></p>\r\n<p>Primer neuravnoteÅ¾enega dvoji&scaron;kega drevesa(da je drevo hkrati tudi iskalno ni pomembno):</p>\r\n<p><img src=\"../source/Neuravnotezenodvojiskodrevo.png\" alt=\"\" width=\"332\" height=\"259\" /></p></p><h4><strong>Dodatne opombe:</strong></h4><p>Prazno dvojiÅ¡ko drevo je uravnoteÅ¾eno drevo</p>', 'DvojiÅ¡ko drevo', 1, 48),
(55, 6, 'Implementacija razreda MaxSklad', '<h4><strong>VpraÅ¡anje:</strong></h4><p>Implementiraj nov razred MaxSklad, ki ima metodo, ki vraÄa najveÄji element v skladu. Pri tem tega elementa ne odstrani</p><h4><strong>KljuÄne besede:</strong></h4><p>Sklad</p><h4><strong>Vir:</strong></h4><a href=\"https://www.interviewcake.com/question/python/largest-stack \">https://www.interviewcake.com/question/python/largest-stack </a><h4><strong>Odgovor:</strong></h4><p><p>Prvotna ideja bi bila, da napi&scaron;emo metode v tem novem razredu MaxSklad enake, kot pri implementaciji sklada. Metodo za vraÄanje najveÄjega elementa pa tako, da gremo skozi celoten sklad in vrnemo najveÄji element. To je seveda pravilno, vendar bi bila Äasovna zahtevnost O(n).&nbsp;</p>\r\n<p>Druga ideja bi recimo bila, da znotraj razreda definiramo neko spremenljivko v kateri hranimo najveÄji element. Torej bi pri vstavljanje pogledali ali je nov podatek veÄji od do sedaj najveÄjega elementa in Äe je ga poleg vstavljanja v sklad dodamo tudi v to spremenljivko. Problem je tukaj pri odstranjevanju. Ker, Äe bi zbrisali najveÄji element iz sklada, potem nebi veÄ vedeli kateri je najveÄji element. Ponovno bi morali skozi celoten sklad in najti najveÄji element. To bi pa bilo v najslab&scaron;em primeru(odstranjujemo iz sklada v katerem so elementi v padajoÄem vrstnem redu) Äasovne zahtevnosti O(n).&nbsp;</p>\r\n<p>Glavna ideja je, da hranimo najveÄje elemente v nekem trenutku, v nekem dodatnem skladu. Torej pri metodi pripravi definiramo dodaten sklad. Ko vstavljamo podatke v sklad moramo pogledati, Äe je ta podatek veÄji ali enak zgornjemu podatku v pomoÅ¾nem skladu. ÄŒe je ga dodamo tudi v ta pomoÅ¾en sklad.</p>\r\n<p>Ko odstranjujemo iz sklada moramo preveriti, Äe je odstranjen podatek iz sklada tudi najveÄji. To naredimo, da ga primerjamo z vrhnjim podatkom iz pomoÅ¾nega sklada. ÄŒe sta podatka enaka, podatek odstranimo tudi iz pomoÅ¾nega sklada.&nbsp;</p>\r\n<p>Metoda, ki vraÄa najveÄji element v skladu pa vrne vrhnji podatek v pomoÅ¾nem skladu.</p></p><h4><strong>Dodatne opombe:</strong></h4><p>Metodi vrh in prazno sta enaki, kot pri pri standardnem skladu.</p>', 'Sklad', 1, 49),
(56, 6, 'Preveri ali je dan niz pravilen', '<h4><strong>VpraÅ¡anje:</strong></h4><p>ÄŒe imamo podan niz sestavljen le iz znakov \"()[]{}\", preveri ali je dan niz pravilen. To pomeni, da se vsi oklepaji ujemajo in so pravilno gnezdeni.</p><h4><strong>KljuÄne besede:</strong></h4><p>Sklad</p><h4><strong>Vir:</strong></h4><a href=\"http://www.programcreek.com/2012/12/leetcode-valid-parentheses-java/\">http://www.programcreek.com/2012/12/leetcode-valid-parentheses-java/</a><h4><strong>Odgovor:</strong></h4><p><p>Definiramo si sklad. Sprehodimo se skozi vse znake v nizu. Preverimo ali je znak predklepaj, Äe je ga dodamo na sklad. ÄŒe je znak zaklepaj pa preverimo ali je sklad prazen ter Äe se ujema z znakom na vrhu sklada. ÄŒe se znak na vrhu odstranimo. ÄŒe se ne ujema niso pravilno gnezdeni.&nbsp; Na koncu preverimo le &scaron;e ali sklad prazen. ÄŒe je so bili oklepaji pravilno gnezdeni.</p></p><h4><strong>Dodatne opombe:</strong></h4><p>V priloÅ¾eni datoteki najdete implementacijo algoritma v jeziku python. Implementacija vsebuje veÄ komentarjev kot kode in tako razloÅ¾i algoritem bolje, kot tukaj v odstavku Odgovor. Implementacija je napisana tako, da bi z njo lahko preverjali tudi pravilnost gnezdenja oklepajev naprimver v aritmetiÄnih izrazih saj znake, ki ni so del oklepajev enostavno ignorira.</p>', 'Sklad', 1, 50),
(57, 6, 'S pomoÄjo rekurzije uredi sklad po velikosti', '<h4><strong>VpraÅ¡anje:</strong></h4><p>S pomoÄjo rekurzije uredi sklad po velikosti</p><h4><strong>KljuÄne besede:</strong></h4><p>Sklad, Rekurzija</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/sort-a-stack-using-recursion/\">http://www.geeksforgeeks.org/sort-a-stack-using-recursion/</a><h4><strong>Odgovor:</strong></h4><p><p>Na nepraznem skladu rekurzivno izpraznimo sklad. Nato pokliÄemo pomoÅ¾no funkcijo, ki nam vse odstranjene elemente ponovno vstavi v sklad.&nbsp;</p>\r\n<p id=\"yui_3_17_2_2_1502045426626_189\">Pri vstavljanju elementa nam funkcija preveri, Äe je vrh sklada manj&scaron;i/veÄji (odvisno od urejenosti) od elementa, ki ga vstavljamo. V primeru, da temu ni tako, odstranjujemo vrhnje elemente sklada, dokler ne izpolnimo zgornjega pogoja. Po vstavljanju vse prej&scaron;nje vrhne elemente vstavimo nazaj v sklad.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ÄŒasovna zahtevnost:</strong>&nbsp;O(n^2)</p></p><h4><strong>Dodatne opombe:</strong></h4><p>Prazen sklad je Å¾e urejen sklad.</p>', 'Sklad, Rekurzija', 1, 51),
(59, 6, 'V urejenem seznamu poiÅ¡Äi par Å¡tevil, katera vsota je najbliÅ¾ja Å¡tevilu x', '<h4><strong>VpraÅ¡anje:</strong></h4><p>V urejenem seznamu poiÅ¡Äi par Å¡tevil, katera vsota je najbliÅ¾ja Å¡tevilu x</p><h4><strong>KljuÄne besede:</strong></h4><p>Seznam</p><h4><strong>Vir:</strong></h4><a href=\"http://quiz.geeksforgeeks.org/given-sorted-array-number-x-find-pair-array-whose-sum-closest-x/\">http://quiz.geeksforgeeks.org/given-sorted-array-number-x-find-pair-array-whose-sum-closest-x/</a><h4><strong>Odgovor:</strong></h4><p><p>&nbsp;Vzamemo prvi in zadnji element v seznamu in izraÄunamo vsoto. ÄŒe je vsota manj&scaron;a od &scaron;tevila, potem poveÄamo levi indeks, saj bomo tako dobili veÄjo vsoto in se poskusili bolj pribliÅ¾ati &scaron;tevilu.&nbsp;</p>\r\n<p>ÄŒe pa je vsota veÄja od &scaron;tevila pa zmanj&scaron;amo desni indeks in tako dobimo manj&scaron;o vsoto.</p>\r\n<p>Vrnemo par, ki ima vsoto najbliÅ¾je danemu &scaron;tevilu.</p>\r\n<p>&nbsp;</p></p><h4><strong>Dodatne opombe:</strong></h4><p>ÄŒasovna zahtevnost: O(n)</p>', 'Seznam', 1, 53),
(60, 6, '3. element veriÅ¾nega seznama, iz konca proti zaÄetku, z enim pregledom celega veriÅ¾nega seznama', '<h4><strong>VpraÅ¡anje:</strong></h4><p>PoiÅ¡Äi 3 element veriÅ¾nega seznama, iz konca proti zaÄetku, z enim pregledom celega veriÅ¾nega seznama</p><h4><strong>KljuÄne besede:</strong></h4><p>VeriÅ¾ni seznam</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/nth-node-from-the-end-of-a-linked-list/\">http://www.geeksforgeeks.org/nth-node-from-the-end-of-a-linked-list/</a><h4><strong>Odgovor:</strong></h4><p><p>Ideja je, da nalogo re&scaron;imo z dvema kazalcema. Prvi kazalec bo potoval Äez celotni veriÅ¾ni seznam, drugi pa se bo soÄasno premikal kot prvi, le da bo 2 vozla bolj nazaj. Tako bo, ko bo prvi kazalec pri&scaron;el do konca veriÅ¾nega seznama (naslednji bo None), drugi kazalec kazal na 3 vozel od zadaj.&nbsp;</p></p><h4><strong>Dodatne opombe:</strong></h4><p>V primeru, da veriÅ¾ni seznam krajÅ¡i od 3, pa bo funkcija vrnila None. ÄŒasovna zahtevnost algoritma je O(n).</p>', 'VeriÅ¾ni seznam', 1, 54),
(61, 6, 'MehurÄkasto urejanje', '<h4><strong>VpraÅ¡anje:</strong></h4><p>MehurÄkasto urejanje</p><h4><strong>KljuÄne besede:</strong></h4><p>Urejanje</p><h4><strong>Vir:</strong></h4><a href=\"http://stackoverflow.com/questions/895371/bubble-sort-homework\">http://stackoverflow.com/questions/895371/bubble-sort-homework</a><h4><strong>Odgovor:</strong></h4><p><p>Ideja mehurÄkastega urejanja je da na vsakem koraku potujemo po seznamu od prvega do predzadnjega elementa, ta element pa primerjamo z desnim sosedom. V primeru, da je desni sosed manj&scaron;i od trenutnega elementa, ju zamenjamo. Na koncu vsakega koraka bo zagotovo najveÄji element seznama na svojem mestu (to bi se zgodilo saj, ko je trenutni element najveÄji, se bo ob primerjanju s svojim desnim sosedom vedno zamenjal, potoval v desno). Zato lahko na vsakem naslednjem koraku naredimo eno primerjanje manj.</p>\r\n<p>Dodatno lahko optimiziramo algoritem tako(manj primerjanj) , da naredimo dodatno spremenljivko urejen. Na zaÄetku seznam ni urejen (urejen = False). Na vsakem koraku pa reÄemo, da je seznam urejen (urejn = True), Äe je na koncu koraka algoritem &scaron;e vedno urejen, to pomeni da nismo imeli nobene zamenjave sosedov. Zato vemo, da so vi elementi v urejenem vrstnem redu, saj bi se v nasprotnem primeru vsaj dva elementa zamenjala.</p></p><h4><strong>Dodatne opombe:</strong></h4><p>ÄŒasovna zahtevnost je v najboljÅ¡em primeru enaka O(n) , to je ko so podatki v seznamu Å¾e urejeni. V priÄakovanem in najslabÅ¡em primeru pa je Äasovna zahtevnost O(n^2). KarakteristiÄna operacija je primerjanje, n je Å¡tevilo elementov v seznamu.</p>', 'Urejanje', 1, 55),
(62, 6, 'Za dano dvojiÅ¡ko drevo, ki ima v vozlih cela Å¡tevila, poiÅ¡Äi vse poti, na katerih je vsota vseh vozlov enaka izbrani vsoti.', '<h4><strong>Vpra&scaron;anje:</strong></h4>\r\n<p>Za dano dvoji&scaron;ko drevo, ki ima v vozlih cela &scaron;tevila, poi&scaron;Äi vse poti, na katerih je vsota vseh vozlov enaka izbrani vsoti.</p>\r\n<h4><strong>KljuÄne besede:</strong></h4>\r\n<p>Vsota, Dvoji&scaron;ko drevo</p>\r\n<h4><strong>Vir:</strong></h4>\r\n<p><a href=\"http://www.geeksforgeeks.org/print-k-sum-paths-binary-tree/\">http://www.geeksforgeeks.org/print-k-sum-paths-binary-tree/</a></p>\r\n<h4><strong>Odgovor:</strong></h4>\r\n<p><strong>&nbsp;Pot se lahko zaÄne s katerim koli vozli&scaron;Äem v drevesu, vsako naslednje vozli&scaron;Äe na poti pa je lahko le sin zadnjega vozli&scaron;Äa na poti. Na spodnji sliki so trije primeri poti (<em>opomba: v vozli&scaron;Äih je oznaka vozli&scaron;Äa in ne vrednost v vozli&scaron;Äu</em>).</strong></p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Primer: Eno samo vozli&scaron;Äe je pot.</li>\r\n<li>Primer: Primer poti.</li>\r\n<li>Primer: Primer, ki ni pot.</li>\r\n</ol>\r\n<p><img src=\"../source/Zajetaslika1.jpg\" alt=\"\" width=\"630\" height=\"276\" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Odgovor:</strong>&nbsp;Ideja algoritma je, da vse poti i&scaron;Äemo rekurzivno s pomoÄjo premega pregleda drevesa. In sicer to storimo tako, da si shranjujemo vrednost v posameznem vozli&scaron;Äu na poti do tega vozli&scaron;Äa. Nato pa od odspodaj navzgor i&scaron;Äemo vse moÅ¾ne poti tako, da zaÄnemo pri listih. Vsak list sestavlja nivo lista - poti (spodnja slika, 1. pot je list sam).&nbsp;Za vsako pot, preverimo Äe je vsota vrednosti v vozli&scaron;Äih enaka izbrani vsoti, Äe je jo shranimo.&nbsp;Tako postopoma izkljuÄujemo vse liste vkljuÄno s korenom drevesa.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"../source/Zajetaslika.jpg\" alt=\"\" width=\"286\" height=\"244\" /><img src=\"../source/Zajetaslika2.jpg\" alt=\"\" width=\"491\" height=\"273\" /></p>\r\n<h4><strong>Dodatne opombe:</strong></h4>', 'Vsota, DvojiÅ¡ko drevo', 1, 56),
(63, 6, 'Funkcija, ki vrne preseÄiÅ¡Äe dveh veriÅ¾nih seznamov', '<h4><strong>VpraÅ¡anje:</strong></h4><p>NapiÅ¡i funkcijo, ki vrne preseÄiÅ¡Äe dveh veriÅ¾nih seznamov</p><h4><strong>KljuÄne besede:</strong></h4><p>VeriÅ¾ni seznam</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/write-a-function-to-get-the-intersection-point-of-two-linked-lists/\">http://www.geeksforgeeks.org/write-a-function-to-get-the-intersection-point-of-two-linked-lists/</a><h4><strong>Odgovor:</strong></h4><p><p>Pri ideji izhajamo iz ugotovitve, da Äe ustvarimo dva \'zlepljena\' seznama (prvi izgleda tako, da prvemu zaÄetnemu veriÅ¾nemu seznamu prilepimo drugi veriÅ¾ni seznam, drugi pa izgleda tako, da drugemu veriÅ¾nemu seznamu prilepimo prvi veriÅ¾ni seznam), sta dolÅ¾ini teh \'zlepkov\' enaki. Ker naj bi bilo zadnjih nekaj vozlov zaÄetnih veriÅ¾nih seznamov enakih (Äe niso, je enak vsaj kazalec na None), sta enaka tudi konca \'zlepkov\' in &nbsp;lahko ustvarimo zanko po obeh \'zlepkih\' dokler ne najdemo enakega vozla (oz.None).</p>\r\n<p>Razdelan odgovor je na priloÅ¾eni datoteki.</p>\r\n<p><strong>Dodatni viri:</strong>&nbsp;</p>\r\n<ul>\r\n<li><a href=\"http://www.geeksforgeeks.org/intersection-of-two-sorted-linked-lists/\">http://www.geeksforgeeks.org/intersection-of-two-sorted-linked-lists/</a></li>\r\n<li><a href=\"https://leetcode.com/problems/intersection-of-two-linked-lists/?tab=Description#/description\">https://leetcode.com/problems/intersection-of-two-linked-lists/?tab=Description#/description</a></li>\r\n</ul></p><h4><strong>Dodatne opombe:</strong></h4><p>Ne primerjamo podatkov v vozlih, temveÄ naslove vozlov v pomnilniku, ker iÅ¡Äemo isti vozel (in ne enak vozel).  Nalogo sem reÅ¡il z verigo vozlov in ne ravno z veriÅ¾nim seznamom, vendar je preskok na veriÅ¾ne sezname dokaj preprost.</p>', 'VeriÅ¾ni seznam', 1, 57),
(64, 6, 'ZdruÅ¾i dva urejena veriÅ¾na seznama', '<h4><strong>VpraÅ¡anje:</strong></h4><p>ZdruÅ¾i dva urejena veriÅ¾na seznama</p><h4><strong>KljuÄne besede:</strong></h4><p>VeriÅ¾ni seznam, Urejanje</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/merge-two-sorted-linked-lists/\">http://www.geeksforgeeks.org/merge-two-sorted-linked-lists/</a><h4><strong>Odgovor:</strong></h4><p><p>KljuÄna ideja je, da na nov veriÅ¾ni seznam iz zaÄetnih veriÅ¾nih seznamov vedno prikljuÄujemo tisti vozel, ki ima najmanj&scaron;i podatek. Ko vozel prikljuÄimo na nov veriÅ¾ni seznam, ga iz zaÄetnega veriÅ¾nega seznama izbri&scaron;emo. Pri tem novih vozlov ne ustvarjamo, vendar uporabljamo vozle iz zaÄetnih veriÅ¾nih seznamov.</p>\r\n<p>Razdelan odgovor je na priloÅ¾eni datoteki.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Dodatni viri:</strong>&nbsp;</p>\r\n<ul>\r\n<li><a href=\"http://ideone.com/bahVef\">http://ideone.com/bahVef#</a></li>\r\n<li><a href=\"http://code.geeksforgeeks.org/Bmrdew\">http://code.geeksforgeeks.org/Bmrdew</a></li>\r\n<li><a href=\"http://stackoverflow.com/questions/10707352/interview-merging-two-sorted-singly-linked-list\">http://stackoverflow.com/questions/10707352/interview-merging-two-sorted-singly-linked-list</a></li>\r\n<li><a href=\"http://algorithmsandme.in/2013/10/merge-two-sorted-linked-lists-in-one-list/\">http://algorithmsandme.in/2013/10/merge-two-sorted-linked-lists-in-one-list/</a></li>\r\n<li><a href=\"https://www.careercup.com/question?id=8713959\">https://www.careercup.com/question?id=8713959</a></li>\r\n<li><a href=\"http://ideone.com/nxWI28\">http://ideone.com/nxWI28</a></li>\r\n</ul></p><h4><strong>Dodatne opombe:</strong></h4><p>Medtem ko osnovno vpraÅ¡anje ne opredeli natanÄno kaj storiti z enakimi podatki, je pri nekaterih razliÄicah vpraÅ¡anja doloÄeno, da se enaki podatki ne smejo ponavljati. V tem primeru v osrednjo zanko dodamo Å¡e en del v if stavek.  Omenil bi Å¡e, da sem nalogo reÅ¡eval z verigo vozlov, ter ne z veriÅ¾nim seznamom kot podatkovno strukturo, saj rekurzivna reÅ¡itev zgleda bolj \'Äista\' Äe delam z vozli. VeriÅ¾ni seznam uporabil bolj kot pomoÅ¾no strukturo, da novih vozlov ne dodajam na naÄin prvi.naslednji.naslednji...., ampak zgolj uporabljam funkcijo vstavi.</p>', 'VeriÅ¾ni seznam, Urejanje', 1, 58),
(65, 6, 'Preveri, Äe je dvojiÅ¡ko drevo poddrevo drugega dvojiÅ¡kega drevesa', '<h4><strong>VpraÅ¡anje:</strong></h4><p>Preveri, Äe je dvojiÅ¡ko drevo poddrevo drugega dvojiÅ¡kega drevesa</p><h4><strong>KljuÄne besede:</strong></h4><p>DvojiÅ¡ko drevo</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/check-if-a-binary-tree-is-subtree-of-another-binary-tree/\">http://www.geeksforgeeks.org/check-if-a-binary-tree-is-subtree-of-another-binary-tree/</a><h4><strong>Odgovor:</strong></h4><p><p>Na zaÄetku imamo podani dve drevesi. Zanima nas, Äe je eno dvoji&scaron;ko drevo poddrevo drugega dvoji&scaron;kega drevesa. Osnovna ideja je, da se premikamo po vozli&scaron;Äih drugega drevesa (v splo&scaron;nem veÄjega), ter jih primerjamo z elementi iz prvega drevesa. ÄŒe najdemo ujemanje podatkov preverimo tudi poddrevesa. To ponavljamo, dokler ne najdemo razliÄnega podatka ali pa pridemo do konca.</p>\r\n<p>Razdelan odgovor je na priloÅ¾eni datoteki.</p>\r\n<p>Na prvi sliki je primer, ko je S poddrevo drevesa T.</p>\r\n<p><img src=\"../source/1.jpg\" alt=\"\" width=\"517\" height=\"349\" /></p>\r\n<p>&nbsp;</p>\r\n<p>Na drugi sliki pa je primer, ko S ni veÄ poddrevo T, saj za koren s podatkom 5 velja, da nima enakih naslednikov v S in T.</p>\r\n<p><img src=\"../source/2.jpg\" alt=\"\" width=\"514\" height=\"353\" /></p>\r\n<p>Problem re&scaron;ujemo s preverjanjem podatkov, ter ne naslovov. ÄŒe bi preverjali naslove, bi takoj ko bi naleteli na isti naslov vedeli, da je drevo zagotovo poddrevo.</p>\r\n<p><strong>Dodatni viri:</strong>&nbsp;</p>\r\n<ul>\r\n<li><a href=\"https://discuss.leetcode.com/topic/18/check-if-a-binary-tree-is-a-subtree-of-another-binary-tree\">https://discuss.leetcode.com/topic/18/check-if-a-binary-tree-is-a-subtree-of-another-binary-tree</a></li>\r\n</ul></p><h4><strong>Dodatne opombe:</strong></h4><p>Drevo S je poddrevo drevesa T, Äe za vsak koren drevesa S velja, da ima enake naslednike kot enak koren v T.</p>', 'DvojiÅ¡ko drevo', 1, 59),
(66, 6, 'SimetriÄnost dvojiÅ¡kega drevesa', '<h4><strong>VpraÅ¡anje:</strong></h4><p>ugotovi ali je dvojiÅ¡ko drevo simetriÄno</p><h4><strong>KljuÄne besede:</strong></h4><p>DvojiÅ¡ko drevo</p><h4><strong>Vir:</strong></h4><a href=\"http://www.programcreek.com/2014/03/leetcode-symmetric-tree-java/\">http://www.programcreek.com/2014/03/leetcode-symmetric-tree-java/</a><h4><strong>Odgovor:</strong></h4><p><p>Problem lahko re&scaron;imo s pomoÄjo rekurzije ali s pomoÄjo vrste.&nbsp;</p>\r\n<p>Pri rekurzivni re&scaron;itvi je ideja, da napi&scaron;emo pomoÅ¾no funkcijo, ki ugotovi ali je dvoji&scaron;ko drevo zrcalna slika drugega dvoji&scaron;kega drevesa &ndash; glavna funkcija namreÄ samo preveri ali je drevo mogoÄe prazno, sicer pa na levem ter desnem poddrevesu kliÄe pomoÅ¾no funkcijo.</p>\r\n<p>S pomoÄjo vrste pa je kljuÄna ideja ta, da v vrsto dodajamo poddrevesa dvoji&scaron;kega drevesa in sicer v pravilnem vrstnem redu - torej takem, da vsakiÄ ko dve drevesi primerjamo, primerjamo tisti dve, ki morata biti zrcalna slika drug drugega.</p></p><h4><strong>Dodatne opombe:</strong></h4><p>Prazno drevo in drevo, ki vsebuje samo koren, sta simetriÄni drevesi. ÄŒasovna zahtevnost obeh reÅ¡itev je O(n).</p>', 'DvojiÅ¡ko drevo', 1, 60),
(67, 6, 'Odstrani podvojene elemente iz urejenega veriÅ¾nega seznama', '<h4><strong>VpraÅ¡anje:</strong></h4><p>Odstrani podvojene elemente iz urejenega veriÅ¾nega seznama</p><h4><strong>KljuÄne besede:</strong></h4><p>VeriÅ¾ni seznam</p><h4><strong>Vir:</strong></h4><a href=\"http://www.programcreek.com/2013/01/leetcode-remove-duplicates-from-sorted-list/\">http://www.programcreek.com/2013/01/leetcode-remove-duplicates-from-sorted-list/</a><h4><strong>Odgovor:</strong></h4><p><p>Problem lahko re&scaron;imo na dva naÄina:</p>\r\n<p>-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;Prva ideja je ta, da uporabimo &scaron;e en kazalec, ki v naprej preverja ali je mogoÄe naslednji podatek enak prej&scaron;njemu. ÄŒe je, potem premikamo samo drugi kazalec, na koncu pa samo pravilno preveÅ¾emo vozle. V nasprotnem primeru pa naprej premikamo oba kazalca.</p>\r\n<p>-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -&nbsp;Lahko pa problem re&scaron;imo tudi samo z enim kazalcem, kjer je ideja, da se premikamo po veriÅ¾nem seznamu in vozle kjer so podatki enaki, sproti prevezujemo.</p>\r\n<p><strong>Dodatni viri:</strong>&nbsp;<a href=\"http://stackoverflow.com/questions/16375045/remove-duplicate-elements-from-a-sorted-linked-list\">http://stackoverflow.com/questions/16375045/remove-duplicate-elements-from-a-sorted-linked-list</a></p></p><h4><strong>Dodatne opombe:</strong></h4><p>VeriÅ¾ni seznam spremenimo. ÄŒasovna zahtevnost je O(n), kjer je n Å¡tevilo vozlov. Uporabimo lahko popolnoma enak postopek tudi Äe imamo verigo vozlov, saj prvi vozel ostane vedno nespremenjen. Ko imamo podvojene podatke, vedno prvega pustimo in briÅ¡emo vse naslednje.</p>', 'VeriÅ¾ni seznam', 1, 61),
(68, 6, 'Urejanje z vstavljanjem', '<h4><strong>VpraÅ¡anje:</strong></h4><p>Urejanje z vstavljanjem</p><h4><strong>KljuÄne besede:</strong></h4><p>Urejanje</p><h4><strong>Vir:</strong></h4><a href=\"http://quiz.geeksforgeeks.org/insertion-sort/\">http://quiz.geeksforgeeks.org/insertion-sort/</a><h4><strong>Odgovor:</strong></h4><p><p>Glavna ideja urejanja z vstavljanjem je ta,<strong>&nbsp;</strong>da seznam razdelimo na neurejeni in urejeni del. Nato gremo preko neurejenega dela seznama in vsak element, ki je na vrsti, postavimo na pravilno mesto v urejenem delu seznama.&nbsp;</p></p><h4><strong>Dodatne opombe:</strong></h4><p>Äasovna zahtevnost v najboljÅ¡em primeru je O(n) â€“ ko je seznam Å¾e urejen, v najslabÅ¡em in priÄakovanem primeru pa O(n^2), kjer je n Å¡tevilo elementov. Seznam uredi na mestu, torej spremeni obstojeÄi seznam. Je zelo uÄinkovit za urejanje majhnega Å¡tevila podatkov ter za primere, ko imamo Å¾e skoraj urejen seznam. </p>', 'Urejanje', 1, 62);
INSERT INTO `data` (`ID`, `contributor_ID`, `question`, `answer`, `tag`, `verified`, `upload_ID`) VALUES
(69, 6, 'NajniÅ¾ji skupni prednik dveh elementov iskalnega dvojiÅ¡kega drevesa', '<h4><strong>VpraÅ¡anje:</strong></h4><p> PoiÅ¡Äi najniÅ¾ji skupni prednik dveh elementov (n1 in n2) iskalnega dvojiÅ¡kega drevesa (predpostavimo da sta n1 in n2 res elementa iskalnega dvojiÅ¡kega drevesa). To je skupni prednik, ki se nahaja najdlje od korena.</p><h4><strong>KljuÄne besede:</strong></h4><p>DvojiÅ¡ko drevo</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/lowest-common-ancestor-in-a-binary-search-tree/\">http://www.geeksforgeeks.org/lowest-common-ancestor-in-a-binary-search-tree/</a><h4><strong>Odgovor:</strong></h4><p><p><span lang=\"sl\" xml:lang=\"sl\">LoÄimo tri primere:</span></p>\r\n<p><span lang=\"sl\" xml:lang=\"sl\">&middot;&nbsp; &nbsp; &nbsp; &nbsp; -</span><span lang=\"sl\" xml:lang=\"sl\">elementa n1 in n2 sta oba manj&scaron;a od podatka v korenu (potem se n1 in n2 nahajata v levem poddrevesu &ndash; tudi njun skupni prednik i&scaron;Äemo v levem poddrevesu)</span></p>\r\n<p><span lang=\"sl\" xml:lang=\"sl\">&middot;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-</span><span lang=\"sl\" xml:lang=\"sl\">elementa n1 in n2 sta oba veÄja od korena (n1 in n2 v desnem poddrevesu &ndash; tudi njun skupni prednik i&scaron;Äemo v desnem poddrevesu)</span></p>\r\n<p><span lang=\"sl\" xml:lang=\"sl\">&middot;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-</span><span lang=\"sl\" xml:lang=\"sl\">sicer je njun skupni prednik koren drevesa v katerem se nahajamo</span></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span lang=\"sl\" xml:lang=\"sl\">Dodatni viri:</span></strong><span lang=\"sl\" xml:lang=\"sl\">&nbsp;</span></p>\r\n<p><span lang=\"sl\" xml:lang=\"sl\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"sl\" xml:lang=\"sl\"><a href=\"http://stackoverflow.com/questions/8441331/find-lowest-common-ancestor-in-binary-search-tree\">http://stackoverflow.com/questions/8441331/find-lowest-common-ancestor-in-binary-search-tree</a></span></p>\r\n<p><span lang=\"sl\" xml:lang=\"sl\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"sl\" xml:lang=\"sl\"><a href=\"https://www.youtube.com/watch?v=TIoCCStdiFo\">https://www.youtube.com/watch?v=TIoCCStdiFo</a></span></p>\r\n<p><span lang=\"sl\" xml:lang=\"sl\">&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"sl\" xml:lang=\"sl\"><a href=\"http://www.geeksforgeeks.org/lowest-common-ancestor-in-a-binary-tree-set-2-using-parent-pointer/\">http://www.geeksforgeeks.org/lowest-common-ancestor-in-a-binary-tree-set-2-using-parent-pointer/</a></span></p></p><h4><strong>Dodatne opombe:</strong></h4><p>Rekurziven in iterativen algoritem imata oba Äasovno zahtevnost v najslabÅ¡em primeru O(h), kjer je h viÅ¡ina drevesa. Zaradi shranjevanja vmesnih reÅ¡itev na sklad rekurziven algoritem porabi Å¡e O(h) dodatnega prostora (v najslabÅ¡em primeru), Äemur se lahko izognemo, Äe uporabimo iterativen algoritem. Iskanje najniÅ¾jega skupnega prednika je uporabno npr. pri raÄunanju razdalj med pari vozliÅ¡Ä v iskalnem dvojiÅ¡kem drevesu.</p>', 'DvojiÅ¡ko drevo', 1, 63),
(70, 6, 'Funkcija, ki zdruÅ¾i najprej vsa liha in nato vsa soda vozliÅ¡Äa veriÅ¾nega seznama', '<h4><strong>VpraÅ¡anje:</strong></h4><p>NapiÅ¡i funkcijo, ki zdruÅ¾i najprej vsa liha in nato vsa soda vozliÅ¡Äa veriÅ¾nega seznama</p><h4><strong>KljuÄne besede:</strong></h4><p>VeriÅ¾ni seznam</p><h4><strong>Vir:</strong></h4><a href=\"http://www.programcreek.com/2015/03/leetcode-odd-even-linked-list-java/\">http://www.programcreek.com/2015/03/leetcode-odd-even-linked-list-java/</a><h4><strong>Odgovor:</strong></h4><p><p><span lang=\"sl\" xml:lang=\"sl\">Problem re&scaron;imo z uporabo dveh kazalcev (kazalec lih in sod). Z lihim se pomikamo po lihih vozli&scaron;Äih in jih med sabo zdruÅ¾imo, s sodim pa po sodih in jih med sabo zdruÅ¾imo. Na koncu pa moramo povezati &scaron;e zadnjega lihega s prvim sodim, ki si ga oznaÄimo na zaÄetku.</span></p>\r\n<p>Razdelan odgovor je na priloÅ¾eni datoteki.</p>\r\n<p><strong>Dodatni viri:</strong>&nbsp;</p>\r\n<ul type=\"disc\">\r\n<li><a href=\"https://leetcode.com/articles/odd-even-linked-list/\">https://leetcode.com/articles/odd-even-linked-list/</a></li>\r\n<li><a href=\"http://www.geeksforgeeks.org/rearrange-a-linked-list-such-that-all-even-and-odd-positioned-nodes-are-together/\">http://www.geeksforgeeks.org/rearrange-a-linked-list-such-that-all-even-and-odd-positioned-nodes-are-together/</a></li>\r\n<li><a href=\"http://stackoverflow.com/questions/35568057/odd-even-linked-list/36645313\">http://stackoverflow.com/questions/35568057/odd-even-linked-list/36645313</a></li>\r\n</ul></p><h4><strong>Dodatne opombe:</strong></h4><p>Za reÅ¡evanje naloge sem uporabila verigo vozlov. Liha in soda vozliÅ¡Äa se nanaÅ¡ajo na objekte (vozle) ne pa podatke v njih.  ÄŒasovna zahtevnost algoritma je O(n).</p>', 'VeriÅ¾ni seznam', 1, 64),
(71, 6, 'Podatek v drevesu, ki je najbliÅ¾je k', '<h4><strong>VpraÅ¡anje:</strong></h4><p>ÄŒe imamo podano dvojiÅ¡ko iskalno drevo in Å¡tevilo k, poiÅ¡Äi podatek v drevesu, ki je najbliÅ¾je k</p><h4><strong>KljuÄne besede:</strong></h4><p>DvojiÅ¡ko drevo</p><h4><strong>Vir:</strong></h4><a href=\"http://codercareer.blogspot.si/2013/03/no-45-closest-node-in-binary-search-tree_2.html\">http://codercareer.blogspot.si/2013/03/no-45-closest-node-in-binary-search-tree_2.html</a><h4><strong>Odgovor:</strong></h4><p><p>Pogledamo vrednost v korenu in si zapomnemo absolutno razliko do k. ÄŒe je ta razlika niÄ, lahko vrnemo vrednost v korenu, ker ne bomo na&scaron;li bolj&scaron;e vrednosti. DrugaÄe pa pogledamo ali je vrednost v korenu veÄja od k (lahko najdemo bolj&scaron;o vrednost kveÄjemu v levem poddrevesu) ali manj&scaron;a od k (bolj&scaron;o vrednost i&scaron;Äemo v desnem poddrevesu).</p>\r\n<p><strong><span lang=\"sl\" xml:lang=\"sl\">Dodatni viri:</span></strong><span lang=\"sl\" xml:lang=\"sl\">&nbsp;</span></p>\r\n<p><span lang=\"sl\" xml:lang=\"sl\">&middot;</span><span lang=\"sl\" xml:lang=\"sl\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"sl\" xml:lang=\"sl\"><a href=\"http://www.geeksforgeeks.org/find-closest-element-binary-search-tree/\">http://www.geeksforgeeks.org/find-closest-element-binary-search-tree/</a></span></p>\r\n<p><span lang=\"sl\" xml:lang=\"sl\">&middot;</span><span lang=\"sl\" xml:lang=\"sl\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span lang=\"sl\" xml:lang=\"sl\"><a href=\"http://stackoverflow.com/questions/6209325/how-to-find-the-closest-element-to-a-given-key-value-in-a-binary-search-tree\">http://stackoverflow.com/questions/6209325/how-to-find-the-closest-element-to-a-given-key-value-in-a-binary-search-tree</a></span></p></p><h4><strong>Dodatne opombe:</strong></h4><p> ÄŒasovna zahtevnost v najslabÅ¡em primeru je O(h) v najboljÅ¡em pa O(1), Äe je k enak korenu. Na strani kjer je bilo postavljeno vpraÅ¡anje so predpostavili, da vrnemo samo eno vrednost, v bistvu se pa lahko zgodi, da sta v drevesu dve vrednosti enako blizu Å¡tevilu k (ker gledamo absolutno razliko). V tem primeru bi lahko dodali Å¡e en if stavek kjer preverimo ali je razlika == minRazlika in dali obe vrednosti v seznam. </p>', 'DvojiÅ¡ko drevo', 1, 65),
(72, 6, 'Kako deluje merge sort oz. razvrÅ¡Äanje z zlivanjem?', '<h4><strong>VpraÅ¡anje:</strong></h4><p>Kako deluje merge sort oz. razvrÅ¡Äanje z zlivanjem?</p><h4><strong>KljuÄne besede:</strong></h4><p>Urejanje</p><h4><strong>Vir:</strong></h4><a href=\"http://quiz.geeksforgeeks.org/merge-sort/\">http://quiz.geeksforgeeks.org/merge-sort/</a><h4><strong>Odgovor:</strong></h4><p><p>&nbsp;Merge sort najlaÅ¾je predstavimo kot zlivanje dveh urejenih seznamov.</p>\r\n<p>Funkcija vrne seznam, Äe je le-ta dolÅ¾ine 0 ali 1. Sicer seznam razdelimo na 2 polovici, nato na vsaki polovici izvedemo merge sort. S tem smo dosegli da imamo dva urejena seznama. Nato seznama zlijemo v enega.</p>\r\n<p><strong>ÄŒasovna zahtevnost:</strong>&nbsp;O(nlog(n))</p></p><h4><strong>Dodatne opombe:</strong></h4><p>Seznam dolÅ¾ine 1 ali 0 je urejen.</p>', 'Urejanje', 1, 66),
(73, 6, 'Celebrity problem â€“ problem zvezdnika s pomoÄjo sklada', '<h4><strong>VpraÅ¡anje:</strong></h4><p> ReÅ¡i celebrity problem â€“ problem zvezdnika s pomoÄjo sklada</p><h4><strong>KljuÄne besede:</strong></h4><p>Sklad</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/the-celebrity-problem/\">http://www.geeksforgeeks.org/the-celebrity-problem/</a><h4><strong>Odgovor:</strong></h4><p><p>&nbsp;Problem zvezdnika je sledeÄ: Na zabavi je n oseb. Samo eno osebo (zvezdnika) poznajo vsi. Zvezdnik pa ne pozna nikogar od prisotnih. Zvezdnik ni nujno prisoten na zabavi. Potrebno je ugotoviti ali je zvezdnik na zabavi ali ne. ÄŒe je prisoten, nas zanima, kdo je.</p>\r\n<p>Dana sta seznam vseh oseb na zabavi in funkcija aliPozna(oseba1,oseba2), ki vraÄa True, Äe oseba1 pozna osebo2, sicer pa vrne False.</p>\r\n<p>Najprej damo vse osebe v sklad. Nato iz sklada vzamemo zgornji osebi. Imenujmo ju A in B. Preverimo ali A pozna B. Sedaj imamo dve moÅ¾nosti:</p>\r\n<p>1. A pozna B. A zato ne more biti zvezdnik, saj zvezdnik ne pozna nikogar. V sklad bomo vrnili le B, saj je zanj &scaron;e moÅ¾no, da je zvezdnik.</p>\r\n<p>2. A ne pozna B. B zato ne more biti zvezdnik, saj zvezdnika poznajo vsi. V sklad bomo vrnili le A, saj je zanj &scaron;e moÅ¾no, da je zvezdnik.</p>\r\n<p>To ponavljamo, dokler v skladu ne ostane le &scaron;e ena oseba. Ta oseba &scaron;e ni zvezdnik. Vse kar smo naredili do zdaj je to, da smo odstranili vse, ki gotovo niso zvezdniki. Zadnji je torej le kandidat za zvezdnika. Sedaj preverimo &scaron;e za kandidata ali ga res pozna vsaka oseba in ali on ne pozna nobene. ÄŒe to ni res, zvezdnika ni. V nasprotnem primeru pa je na&scaron; kandidat res zvezdnik.</p>\r\n<p><strong>ÄŒasovna zahtevnost:</strong>&nbsp;V najbolj&scaron;em primeru je O(n) - ko izvedemo prvi pogoj za preverjanje kandidata, izvemo, da ni zvezdnik. V najslab&scaron;em in priÄakovanem pa O(3n) - oseba je zvezdnik, moramo izvesti vse primerjave.</p></p><h4><strong>Dodatne opombe:</strong></h4><p>Zahtevnost merimo v tem kolikokrat kliÄemo funkcijo aliPozna.   VpraÅ¡anje je v izvirniku sicer zastavljeno bolj v sploÅ¡nem, problem lahko reÅ¡ujemo tudi na drugaÄen naÄin (brez uporabe sklada). ÄŒe ima kdo kako idejo, jo lahko objavi.</p>', 'Sklad', 1, 67),
(74, 6, 'Problem najveÄje enake vsote treh skladov', '<h4><strong>VpraÅ¡anje:</strong></h4><p>ReÅ¡i problem najveÄje enake vsote treh skladov</p><h4><strong>KljuÄne besede:</strong></h4><p>Sklad</p><h4><strong>Vir:</strong></h4><a href=\"http://www.geeksforgeeks.org/find-maximum-sum-possible-equal-sum-three-stacks/\">http://www.geeksforgeeks.org/find-maximum-sum-possible-equal-sum-three-stacks/</a><h4><strong>Odgovor:</strong></h4><p><p>Problem najveÄje enake vsote treh skladov je sledeÄ: Podane imamo 3 sklade, ki vsebujejo pozitivna &scaron;tevila. Sklade lahko urejamo le z operacijo odstrani() (t.j. odstrani vrhnji element). Poi&scaron;Äi &scaron;tevilo&nbsp;<em>A</em>&nbsp;za katerega velja:</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;vsota elementov v vsakem skladu (tem lahko prej odstranimo elemente) je enaka&nbsp;<em>A</em></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>A</em>&nbsp;je najveÄje &scaron;tevilo za katerega velja zgornji pogoj</p>\r\n<p>Algoritem je sestavljen iz treh korakov:</p>\r\n<p>1.) IzraÄunamo vsoto vseh skladov.</p>\r\n<p>2.) ÄŒe so vsote enake, je ta vsota na&scaron;e &scaron;tevilo&nbsp;<em>A</em>. Sicer gremo na 3. korak.</p>\r\n<p>3.) Odstranimo vrhnje &scaron;tevilo iz sklada z najveÄjo vsoto in gremo na 2. korak.</p>\r\n<p><strong>ÄŒasovna zahtevnost:</strong>&nbsp;O(n1+n2+n3) v najslab&scaron;em primeru (odstraniti moramo vse elemente, vsota je 0). Pri tem so n1, n2, n3 &scaron;tevilo elementov v posameznem skladu. V najbolj&scaron;em (vsote so enake Å¾e na zaÄetku) pa je Äasovna zahtevnost O(1).</p></p><h4><strong>Dodatne opombe:</strong></h4><p>Za Äasovno zahtevnost gledamo kolikokrat uporabimo funkcijo odstrani().</p>', 'Sklad', 1, 68);

